import React from 'react';
import { Box, Grid } from '@mui/material';
import { Header } from '../../components/Header';
import { ProjectCard } from '../../components/ProjectCard';

export const NoLoginProjects = () => {
  return (
    <Box sx={{ backgroundColor: "rgba(0, 145, 136, 0.8)" }}>
      <Header />
      <Grid container direction="row" paddingLeft="3%" paddingTop="2%" justifyContent="space-evenly">
        <Grid item>
          <ProjectCard
            onClick={() => { }}
            title="Weather App"
            maxWidth="330px"
            description={
              `Aplicação para registrar e monitorar previsões do tempo em diferentes cidades. Não há 
              integração com APIs de previsão real e todos os 
              dados são fictícios, pois podem ser inseridos por qualquer pessoa.`}
            frontLanguage="React.js"
            backLanguage="Java + SpringBoot"
            hosting="Firebase"
          />
        </Grid>
      </Grid>
    </Box>
  )
}
